import * as React from 'react';
import { Link, NavLink } from 'react-router-dom';


export default function Header() {
    const users =[
        {
           name:'Home', 
           id:'home'
        },
        {
            name:'About',
            id:'about' 
         },
         {
            name:'Contact',
            id:'contact' 
         }
    ]
    return (
        <header>
            <nav>
                <ul>
                    {users.map((user) => (
                        <li key={user.id}>
                            <Link to={user.id}>{user.name}</Link>
                        </li>
                    ))}
                </ul>
            </nav>
        </header>
    );
}
